import { BrowserRouter, Routes, Route } from 'react-router-dom';
import {Redirect} from 'react-router-dom'
import { useSelector } from "react-redux";
import Auth from './Auth';

const routes=()=>{
    const isAuth = useSelector(state => state.auth.isAuthenticated);
    return(
<Routes>
    <ProtectiveLogin path='/Auth' isAuth={isAuth} element={<Auth/>} />
    <ProtectiveRoute path='/Homepage' isAuth={isAuth} element={<Homepage/>}/>
</Routes>
    )
}

const ProtectiveRoute=({isAuth,component:Component,...rest})=>{
    return(
        <Route
        {...rest}
        render={()=>isAuth ?(<Component/>):(<Redirect to='/Auth'/>
    )
}
/>
    )
}
const ProtectiveLogin=({isAuth,component:Component,...rest})=>{
    return(
        <Route
        {...rest}
        render={()=>isAuth ?(<Component/>):(<Redirect to='/Auth'/>
    )
}
/>
    )
}

export default routes
